import React from 'react';
import PropsType from 'prop-types';

TodoList.propsType = {
  listTask: PropsType.array,
};

TodoList.defaultProps = {
  listTask: [],
};

function TodoList () {
  return (
    <ul>
      {listTask.map(task => {
        return <li key={task.id}>{task.name}</li>
      })}
    </ul>
  )
}

export default TodoList;
